    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 - + 95 + 16 BETWEEN + - col2 AND + 51 + - - 54 * col1 * + col1;
  - name: tab2

outputs:
  - name: q1168.out
    data: |
      46	51	23
      64	77	40
      75	67	58
